import { INavbar } from "./Navbar.props";
import styles from "./Navbar.module.css";

const Navbar = ({className, ...props}: INavbar ):JSX.Element => {
    return (
        <nav {...props}>
            <div className={styles.logo}>
                MyWeb
            </div>
            <ul>
                <li>
                    Todo
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
